import React, { useState } from 'react';

const Alerts = () => {
  const [alerts, setAlerts] = useState([
    { id: 1, type: 'warning', message: 'Medication reminder: Take your morning pills', time: '9:00 AM', isRead: false },
    { id: 2, type: 'info', message: 'Weekly health checkup scheduled for tomorrow', time: '2 hours ago', isRead: false },
    { id: 3, type: 'success', message: 'Blood pressure reading recorded successfully', time: '1 day ago', isRead: true }
  ]);

  const markAsRead = (alertId) => {
    setAlerts(prev => prev.map(alert => 
      alert.id === alertId ? { ...alert, isRead: true } : alert
    ));
  };

  const markAllAsRead = () => {
    setAlerts(prev => prev.map(alert => ({ ...alert, isRead: true })));
  };

  return (
    <div className="space-y-6">
      <div className="bg-white rounded-xl shadow-lg p-6">
        <div className="flex justify-between items-center mb-4">
          <h3 className="text-xl font-bold text-gray-800">Alerts & Notifications</h3>
          <button 
            onClick={markAllAsRead}
            className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:bg-blue-600 transition-colors"
          >
            Mark All Read
          </button>
        </div>
        
        <div className="space-y-3">
          {alerts.map(alert => (
            <div key={alert.id} className={`flex items-start space-x-3 p-4 border rounded-lg hover:bg-gray-50 transition-colors ${
              alert.isRead ? 'border-gray-200 opacity-75' : 'border-blue-200 bg-blue-50'
            }`}>
                              <span className={`mt-0.5 ${alert.isRead ? 'text-gray-400' : 'text-blue-500'}`}>ðŸ””</span>
              <div className="flex-1">
                <p className={`${alert.isRead ? 'text-gray-600' : 'text-gray-800'}`}>{alert.message}</p>
                <p className="text-sm text-gray-500">{alert.time}</p>
              </div>
              {!alert.isRead && (
                <button 
                  onClick={() => markAsRead(alert.id)}
                  className="text-green-500 hover:text-green-600"
                >
                                     <span>âœ…</span>
                </button>
              )}
            </div>
          ))}
        </div>
      </div>

      <div className="bg-white rounded-xl shadow-lg p-6">
        <h3 className="text-xl font-bold text-gray-800 mb-4">Notification Settings</h3>
        <div className="space-y-4">
          <div className="flex items-center justify-between p-3 border border-gray-200 rounded-lg">
            <span className="text-gray-700">Medication Reminders</span>
            <input type="checkbox" defaultChecked className="toggle" />
          </div>
          <div className="flex items-center justify-between p-3 border border-gray-200 rounded-lg">
            <span className="text-gray-700">Health Check Alerts</span>
            <input type="checkbox" defaultChecked className="toggle" />
          </div>
          <div className="flex items-center justify-between p-3 border border-gray-200 rounded-lg">
            <span className="text-gray-700">Diet Plan Notifications</span>
            <input type="checkbox" className="toggle" />
          </div>
          <div className="flex items-center justify-between p-3 border border-gray-200 rounded-lg">
            <span className="text-gray-700">Emergency Alerts</span>
            <input type="checkbox" defaultChecked className="toggle" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Alerts;
